
BEGIN TRANSACTION;
CREATE TABLE gerund (
    infinitive nvarchar(1000) NOT NULL primary key,
    gerund nvarchar(1000) NOT NULL,
    gerund_english nvarchar(1000)
);
CREATE TABLE infinitive (
    infinitive nvarchar(1000) NOT NULL primary key,
    infinitive_english nvarchar(1000)
);
CREATE TABLE mood (
    mood nvarchar(1000) NOT NULL primary key,
    mood_english nvarchar(1000)
);
CREATE TABLE pastparticiple (
    infinitive nvarchar(1000) NOT NULL primary key,
    pastparticiple nvarchar(1000) NOT NULL,
    pastparticiple_english nvarchar(1000)
);
CREATE TABLE tense (
    tense nvarchar(1000) NOT NULL primary key,
    tense_english nvarchar(1000)
);
CREATE TABLE verbs (
    infinitive nvarchar(1000) NOT NULL,
    mood nvarchar(1000) NOT NULL,
    tense nvarchar(1000) NOT NULL,
    verb_english nvarchar(1000),
    form_1s nvarchar(1000),
    form_2s nvarchar(1000),
    form_3s nvarchar(1000),
    form_1p nvarchar(1000),
    form_2p nvarchar(1000),
    form_3p nvarchar(1000),
    PRIMARY KEY (infinitive, mood, tense)
);
COMMIT TRANSACTION;
